import {useEffect, useState} from 'react'; 
import logo from '../logo.svg';
import {motion} from "framer-motion";

function Left(){
    return (
        <div className='bg-red-400'>
            <img src={logo} alt="Logo" className="w-40 h-10"/>
        </div>
    )
}

function Right(pageactive,setpageactive){
    return (
        <div className='w-[60%] border-4 p-2 flex justify-around items-center '>
            <a onclick={() => setpageactive(1)} href="#about" className={`${pageactive === 1 ? 'text-red' : ''}`}>About</a>
            <a onclick={() => setpageactive(2)} href="#projects" className={``}>Projects</a>
            <a onclick={() => setpageactive(3)} href="#academics" className={``}>Academics</a>
            <a onclick={() => setpageactive(4)} href="#contact" className={``}>Contact</a>
        </div>
    )
}

function Navbar({pageactive, setpageactive}){
    const fillPercent = useState(0);
  // -------------[show/hide nav bar]-------------
    const showNavbar = useState('false');

    return (
        <motion.div transition={{duration:1.5}} className="bg-inherit sticky top-0 left-0 right-0 bg-white flex justify-center items-center border-4 p-2 z-40">
            <div className="w-[50%] flex justify-center space-x-2 border-4 rounded-full p-2 ">
                <Left />
                <Right pageactive={pageactive} setpageactive={setpageactive}/>
                {pageactive}
            </div>
        </motion.div>
    )
}

export default Navbar;
